import React from 'react';
import { BrowserRouter as Router} from 'react-router-dom';
import Navbar from './Navbar'
import AllRoutes from '../AllRoutes';
function About(){
    return(
        <div>
         <Router>
     <Navbar /> 
     <AllRoutes />
    </Router>
         About content</div>
    );
}

export default About;
